import React, { Component } from 'react';
import './timeline.css';

function TimelineSpecificContent(props) {

    return(
        <div>{props.value}</div>
    )

};

class TimelineSpecific extends Component {

    constructor(props) {
        super(props);
        this.state = {
            type: props.type,
            typeVal: 0,
            types: {0: "Programming", 1: "Aviation", 2: "Desgin", 3: "PC Building"}
        };
    }

    changeType = () => {
        this.setState({
            typeVal: (this.state.typeVal + 1) % 4,
            type: this.state.types[this.state.typeVal]
        });
    }

    render() {

        return(

            <>
                <button onClick={this.changeType}>{this.state.type}</button>
    
                <TimelineSpecificContent value={this.state.types} />
            </>
            
        )

    }

};

export default TimelineSpecific;
